<strong>gud-gdbmi-completions</strong> is a compiled Lisp function in `<code>gdb-mi.el</code>'.<br/>
<br/>
(gud-gdbmi-completions CONTEXT COMMAND)<br/>
<br/>
Completion table for GDB/MI commands.<br/>
COMMAND is the prefix for which we seek completion.<br/>
CONTEXT is the text before COMMAND on the line.
